    true,nt"url": null,nt"notes": "<p>This final rule implements a case-mix
    adjusted bundled prospective payment system (PPS) for Medicare outpatient end-stage
    renal disease (ESRD) dialysis facilities beginning January 1, 2011 (ESRD PPS), in
    compliance with the statutory requirement of the Medicare Improvements for Patients
    and Providers Act (MIPPA), enacted July 15, 2008. This ESRD PPS also replaces the
    current basic case-mix adjusted composite payment system and the methodologies for
    the reimbursement of separately billable outpatient ESRD services.</p>n",nt"license_title":
